let africa = {}
let asia = {}
let southeastAsia = {}
let southPacific = {}
let southAmerica = {}
let northAmerica = {}
let middleEast = {}
let europe = {}
let easternEurope = {}
let centralAmerica = {} 
let carribbean = {}
function getSpecificContinentObj(data){
    for (let current in data) {
        let airport = data[current]
        let continent = data[current]['continent']
        switch(continent){
            case 'Africa':
                africa[current] = airport
                break
            case 'Asia':
                asia[current] = airport
                break
            case 'Southeast Asia':
                southeastAsia[current] = airport
                break
            case 'South Pacific':
                southPacific[current] = airport
                break
            case 'South America':
                southAmerica[current] = airport
                break
            case 'Middle East':
                middleEast[current] = airport
                break
            case 'Europe':
                europe[current] = airport
                break
            case 'Eastern Europe':
                easternEurope[current] = airport
                break
            case 'Central America':
                centralAmerica[current] = airport
                break
            case 'Carribbean':
                carribbean[current] = airport
                break
            case 'North America':
                northAmerica[current] = airport
                break
        }
        
    }
}
let allContinents = {}
function getAllContinentsInOneObject(){
    getSpecificContinentObj(data)
    allContinents.africa = africa
    allContinents.asia = asia
    allContinents.southeastAsia = southeastAsia
    allContinents.southPacific = southPacific
    allContinents.southAmerica = southAmerica
    allContinents.northAmerica = northAmerica
    allContinents.middleEast = middleEast
    allContinents.europe = europe
    allContinents.easternEurope = easternEurope
    allContinents.centralAmerica = centralAmerica 
    allContinents.carribbean = carribbean
}
