let usAirports ={}
function getAirportInUS(data){
    getSpecificContinentObj(data)
    for(let count in northAmerica){
        let airport = northAmerica[count]
        if (northAmerica[count]['country'] === 'USA'){
            usAirports[count] = airport
        }
    }
}

